pragma solidity ^0.8.7;

import "@chainlink/contracts/src/v0.8/VRFConsumerBase.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title HeadToHeadGame
 * @dev A simple head-to-head betting game for two players using ERC20 tokens and Chainlink VRF.
 */
contract HeadToHeadGame is VRFConsumerBase, Ownable {
    IERC20 public immutable token;
    uint256 public immutable stake;

    address[2] public players;
    uint8 public joinedCount;

    bytes32 internal keyHash;
    uint256 internal fee;
    uint256 public randomResult;

    bool public resolved;
    address public winner;

    event PlayerJoined(address player);
    event GameCreated(address indexed creator, address token, uint256 stake);
    event RandomnessRequested(bytes32 requestId);
    event GameResolved(address winner);

    /**
     * @param _token        ERC20 token used for staking
     * @param _stake        amount each player must stake
     * @param _vrfCoordinator address of the Chainlink VRF Coordinator
     * @param _link         address of the LINK token
     * @param _keyHash      Chainlink VRF key hash
     * @param _fee          LINK fee for VRF request
     */
    constructor(
        address _token,
        uint256 _stake,
        address _vrfCoordinator,
        address _link,
        bytes32 _keyHash,
        uint256 _fee
    ) VRFConsumerBase(_vrfCoordinator, _link) Ownable(msg.sender) {
        token = IERC20(_token);
        stake = _stake;
        keyHash = _keyHash;
        fee = _fee;
        emit GameCreated(msg.sender, _token, _stake);
    }

    /**
     * @dev Player joins by staking tokens. Must call token.approve() first.
     */
    function joinGame() external {
        require(joinedCount < 2, "Game full");
        require(token.transferFrom(msg.sender, address(this), stake), "Stake transfer failed");
        players[joinedCount] = msg.sender;
        joinedCount++;
        emit PlayerJoined(msg.sender);

        if (joinedCount == 2) {
            requestRandomWinner();
        }
    }

    /**
     * @dev Requests randomness from Chainlink VRF to determine winner.
     */
    function requestRandomWinner() internal returns (bytes32 requestId) {
        require(LINK.balanceOf(address(this)) >= fee, "Not enough LINK");
        requestId = requestRandomness(keyHash, fee);
        emit RandomnessRequested(requestId);
    }

    /**
     * @dev Callback function used by VRF Coordinator
     */
    function fulfillRandomness(bytes32 /* requestId */, uint256 randomness) internal override {
        require(!resolved, "Already resolved");
        randomResult = randomness;
        uint256 idx = randomness % 2;
        winner = players[idx];
        resolved = true;

        uint256 total = stake * 2;
        require(token.transfer(winner, total), "Payout failed");

        emit GameResolved(winner);
    }
}

/**
 * @title GameHub
 * @dev Deploys and tracks individual game contracts.
 */
contract GameHub {
    address[] public games;

    address public vrfCoordinator;
    address public linkToken;
    bytes32 public vrfKeyHash;
    uint256 public vrfFee;

    event GameCreated(address gameAddress, address creator);

    constructor(
        address _vrfCoordinator,
        address _linkToken,
        bytes32 _vrfKeyHash,
        uint256 _vrfFee
    ) {
        vrfCoordinator = _vrfCoordinator;
        linkToken = _linkToken;
        vrfKeyHash = _vrfKeyHash;
        vrfFee = _vrfFee;
    }

    /**
     * @dev Create a new HeadToHeadGame
     * @param tokenAddr ERC20 token address for staking
     * @param stakeAmt  amount each player stakes
     */
    function createHeadToHeadGame(address tokenAddr, uint256 stakeAmt) external returns (address) {
        HeadToHeadGame game = new HeadToHeadGame(
            tokenAddr,
            stakeAmt,
            vrfCoordinator,
            linkToken,
            vrfKeyHash,
            vrfFee
        );
        games.push(address(game));
        emit GameCreated(address(game), msg.sender);
        return address(game);
    }

    /**
     * @dev Get number of games
     */
    function gameCount() external view returns (uint256) {
        return games.length;
    }
}

